import React from "react";
import Card from "./Card.jsx";
import contacts from "./contacts.js";

function App() {
  return (
    <div>
     <h1 className="heading">My Contacts</h1>
          {contacts.map(function (a){
            <Card 
            name = {a.name}
            img = {a.imgURL}
            phone = {a.phone}
            email = {a.email}
            />

          })
        }
    </div>
  );
}

export default App;
